import React, { useState } from "react";
import "./Dashboard.css";
import CreateFolderModal from "./CreateFolderModal";
import CreateFormModal from "./CreateFormModal";
import DeleteFolderModal from "./DeleteFolderModal";
import DeleteFormModal from "./DeleteFormModal";

const Dashboard = () => {
  const [folders, setFolders] = useState([]);
  const [forms, setForms] = useState([]);
  const [selectedFolderIndex, setSelectedFolderIndex] = useState(null);
  const [modalType, setModalType] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [deleteIndex, setDeleteIndex] = useState(null);

  const openModal = (type, index = null) => {
    setModalType(type);
    setDeleteIndex(index);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setModalType(null);
  };

  const handleCreateFolder = (folderName) => {
    setFolders([...folders, { name: folderName, forms: [] }]);
    closeModal();
  };

  const handleCreateForm = (formName, folderIndex = null) => {
    if (folderIndex !== null) {
      const updatedFolders = [...folders];
      updatedFolders[folderIndex].forms.push(formName);
      setFolders(updatedFolders);
    } else {
      setForms([...forms, formName]);
    }
    closeModal();
  };

  const handleDeleteFolder = () => {
    setFolders(folders.filter((_, index) => index !== deleteIndex));
    closeModal();
  };

  const handleDeleteForm = () => {
    if (selectedFolderIndex !== null) {
      const updatedFolders = [...folders];
      updatedFolders[selectedFolderIndex].forms = updatedFolders[
        selectedFolderIndex
      ].forms.filter((_, index) => index !== deleteIndex);
      setFolders(updatedFolders);
    } else {
      setForms(forms.filter((_, index) => index !== deleteIndex));
    }
    closeModal();
  };

  return (
    <div className="dashboard">
      <div className="sidebar">
        <button onClick={() => openModal("folder")}>+ Create Folder</button>
        <div className="folder-list">
          {folders.map((folder, index) => (
            <div
              key={index}
              className="folder-item"
              onClick={() => setSelectedFolderIndex(index)}
            >
              {folder.name}
              <button
                className="delete-btn"
                onClick={(e) => {
                  e.stopPropagation();
                  openModal("deleteFolder", index);
                }}
              >
                ✕
              </button>
            </div>
          ))}
        </div>
      </div>
      <div className="content">
        <div className="header">
          <button onClick={() => openModal("form")}>+ Create Form</button>
        </div>
        <div className="form-list">
          {selectedFolderIndex !== null
            ? folders[selectedFolderIndex].forms.map((form, index) => (
                <div key={index} className="form-item">
                  {form}
                  <button
                    className="delete-btn"
                    onClick={() => openModal("deleteForm", index)}
                  >
                    ✕
                  </button>
                </div>
              ))
            : forms.map((form, index) => (
                <div key={index} className="form-item">
                  {form}
                  <button
                    className="delete-btn"
                    onClick={() => openModal("deleteForm", index)}
                  >
                    ✕
                  </button>
                </div>
              ))}
        </div>
      </div>
      {isModalOpen && modalType === "folder" && (
        <CreateFolderModal
          closeModal={closeModal}
          onCreateFolder={handleCreateFolder}
        />
      )}
      {isModalOpen && modalType === "form" && (
        <CreateFormModal
          closeModal={closeModal}
          onCreateForm={(formName) =>
            handleCreateForm(formName, selectedFolderIndex)
          }
        />
      )}
      {isModalOpen && modalType === "deleteFolder" && (
        <DeleteFolderModal
          closeModal={closeModal}
          onConfirm={handleDeleteFolder}
        />
      )}
      {isModalOpen && modalType === "deleteForm" && (
        <DeleteFormModal closeModal={closeModal} onConfirm={handleDeleteForm} />
      )}
    </div>
  );
};

export default Dashboard;
